import './BlueButton.css';
import React from 'react';

function BlueButton (props){
    return(
        <div>
            <h1>{props.header}</h1>
            <button> {props.name} </button>
            <h2>{props.head2}</h2>
            
            </div>
        
    )
};


export default BlueButton;
